import { WorldRanking } from "../components"
import { useState, useEffect } from 'react';


const RankingsPage = () => {

  const [rankingType, setRankingType] = useState("");

  return (
    <div>
      <h1>Rankings Page</h1>
      <button onClick={rankingType === "" ? () => setRankingType("world") : () => setRankingType("")}>World Ranking</button>
      <button className="ml-8" onClick={rankingType === "" ? () => setRankingType("cs") : () => setRankingType("")}>Computer Science Ranking</button>
      { rankingType === "world" &&
        <WorldRanking type={rankingType} />
      }
      { rankingType === "cs" &&
        <p>CS</p>
      }
    </div>
  )
}

export default RankingsPage
